use portal;

DROP TABLE IF EXISTS sensitive_species;

CREATE TABLE sensitive_species (
    id INTEGER(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    scientific_name VARCHAR(255) NOT NULL,
    family VARCHAR(255) NOT NULL,
    common_name VARCHAR(255) NOT NULL);

-- Conservation sensitive species


CREATE INDEX scientific_name_idx ON sensitive_species (scientific_name);

DROP TABLE IF EXISTS sensitive_species_zones;

CREATE TABLE sensitive_species_zones (
    id INTEGER(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    scientific_name VARCHAR(255) NOT NULL,
    sensitivity_zone VARCHAR(255) NOT NULL,
    authority VARCHAR(255) NOT NULL,
    from_date DATE,
    to_date DATE,
    sensitivity_category VARCHAR(50) NOT NULL);

